class InputHelper{static NODE_TYPE_INPUT = 'INPUT';static NODE_TYPE_SELECT = 'SELECT';static NODE_TYPE_DIV = 'DIV';static NODE_TYPE_TEXTAREA = 'TEXTAREA';static INPUT_TYPE_FILE = 'file';static INPUT_TYPE_CHECKBOX = 'checkbox';static INPUT_TYPE_RADIO = 'radio';static RETURN_TYPE_INPUT = 'input';static RETURN_TYPE_VALUE = 'value';static INPUT_TYPE_TEXT = 'text';static INPUT_TYPE_SELECT_ONE = 'select-one';static INPUT_TYPE_SELECT_MULTIPLE = 'select-multiple';constructor(){throw Error("This class donÂ´t should be instantiated")}static getHiddenInput(e,t,n){if(0===t.length)return`<input type="hidden" name="${this.getNewNameInput(e,!1,n)}" value="" data-reference="">`;let p=[];return t.forEach(r=>{p.push(`<input \n                    type="hidden" \n                    name="${this.getNewNameInput(e,t.length>1,n)}"\n                    value="${r.value}" \n                    ${r.reference?`data-reference="${r.reference}"`:""}\n                >`)}),p.join("")}static getNewNameInput(e,t=!1,n){return t?e.replace("<@>",n)+"[]":e.replace("<@>",n)}static inputIsText(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_TEXT}static inputIsFile(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_FILE}static inputIsCheckbox(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_CHECKBOX}static inputIsRadio(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_RADIO}static elementIsInput(e){return e.prop("tagName")===InputHelper.NODE_TYPE_INPUT}static elementIsTextArea(e){return e.prop("tagName")===InputHelper.NODE_TYPE_TEXTAREA}static elementIsSelect(e){return e.prop("tagName")===InputHelper.NODE_TYPE_SELECT}static elementIsDiv(e){return e.prop("tagName")===InputHelper.NODE_TYPE_DIV}static getTypeInput(e){return e.prop("type")}static inputIsSelectMultiple(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_SELECT_MULTIPLE}static inputIsSelectOne(e){return this.getTypeInput(e)===InputHelper.INPUT_TYPE_SELECT_ONE}static inputIsSelectAndOne(e){return this.elementIsSelect(e)&&this.inputIsSelectOne(e)}static inputIsSelectAndMultiple(e){return this.elementIsSelect(e)&&this.inputIsSelectMultiple(e)}static elementIsDivAndRadio(e){const t=$(e).find('input[type="radio"]');return this.elementIsDiv(e)&&t.length>0}static elementIsDivAndCheckbox(e){const t=$(e).find('input[type="checkbox"]');return this.elementIsDiv(e)&&t.length}}